      function __resizeIframe(obj) {
        var scrollbarHeight = 20; // Max between windows, mac, and linux

        function setHeight() {
          var element = obj.contentWindow.document.documentElement;
          // If there is no vertical scrollbar, we don't need to resize the iframe
          if (element.scrollHeight === element.clientHeight) {
            return;
          }

          // Create a new height that includes the scrollbar height if it's visible
          var hasHorizontalScrollbar = element.scrollWidth > element.clientWidth;
          var newHeight = element.scrollHeight + (hasHorizontalScrollbar ? scrollbarHeight : 0);

          // Only update the height if it's different from the current height
          if (obj.style.height !== `${newHeight}px`) {
            obj.style.height = `${newHeight}px`;
          }
        }

        // Resize the iframe to the height of the content and bottom scrollbar height
        setHeight();

        // Resize the iframe when the content changes
        const resizeObserver = new ResizeObserver((entries) => {
          setHeight();
        });
        resizeObserver.observe(obj.contentWindow.document.body);
      }
    </script>

<style title='marimo-custom'>/* Import des polices */
@import url('https://fonts.googleapis.com/css2?family=Inter:wght@600;800&family=Lato:wght@400&display=swap');

/* Définir les polices */
:root {
  --marimo-heading-font: 'Inter', sans-serif;
  --marimo-text-font: 'Lato', sans-serif;
  --marimo-monospace-font: 'Courier New', monospace;

  /* Dégradé de fond */
  --background: radial-gradient(circle at top left, #0F1123, #090B17);
  --foreground: white;
}

/* Assure une couleur blanche pour tous les textes */
body,
html,
.paragraph,
.markdown,
h1, h2, h3, h4, h5, h6,
strong, b, em,
.mo-markdown,
.mo-cell-output,
.mo-cell-input {
  color: white !important;
  font-family: var(--marimo-text-font);
}

/* Texte noir dans les menus déroulants */
select,
.mo-ui-select,
.mo-ui-select option {
  color: black !important;
  background-color: white !important;
}

/* Cible uniquement les tableaux Markdown générés par Marimo */
table {
  width: 100% !important;
  border-collapse: collapse !important;
  background-color: transparent !important;
  background: transparent !important;
  color: white !important;
  font-family: var(--marimo-text-font) !important;
}

/* Forcer le fond transparent pour toutes les lignes */
tr,
tbody tr,
thead tr {
  background-color: transparent !important;
  background: transparent !important;
}

th,
td {
  border: 1px solid white !important;
  padding: 0.5rem !important;
  background-color: transparent !important;
  background: transparent !important;
  color: white !important;
}

/* Contrer les styles par défaut qui pourraient causer un fond blanc */
table[class*="table"],
.table,
.table th,
.table td,
.table tr {
  background-color: transparent !important;
  background: transparent !important;
  color: white !important;
}

/* Forcer la couleur blanche pour tous les éléments dans les en-têtes */
th,
th *,
thead th,
thead th *,
thead td,
thead td * {
  font-weight: 800 !important;
  text-align: left !important;
  color: white !important;
  background-color: transparent !important;
}

/* Forcer la couleur blanche pour toutes les cellules */
td,
td *,
tbody td,
tbody td *,
tbody th,
tbody th * {
  color: white !important;
  background-color: transparent !important;
}

/* Spécifique pour Marimo */
.mo-markdown table {
  width: 100% !important;
  border-collapse: collapse !important;
  background-color: transparent !important;
  color: white !important;
  font-family: var(--marimo-text-font) !important;
}

.mo-markdown th,
.mo-markdown td {
  border: 1px solid white !important;
  padding: 0.5rem !important;
  background-color: transparent !important;
  color: white !important;
}

.mo-markdown th,
.mo-markdown th *,
.mo-markdown thead th,
.mo-markdown thead th *,
.mo-markdown thead td,
.mo-markdown thead td * {
  font-weight: 800 !important;
  text-align: left !important;
  color: white !important;
  background-color: transparent !important;
}

.mo-markdown td,
.mo-markdown td *,
.mo-markdown tbody td,
.mo-markdown tbody td *,
.mo-markdown tbody th,
.mo-markdown tbody th * {
  color: white !important;
  background-color: transparent !important;
}

/* Effet de survol - fond sombre pour garder le texte blanc lisible */
tr:hover,
tr:hover *,
.mo-markdown tr:hover,
.mo-markdown tr:hover * {
  background-color: rgba(255, 255, 255, 0.1) !important;
  color: white !important;
}



/* Titres */
h1, h2, h3, h4, h5, h6 {
  font-family: var(--marimo-heading-font) !important;
  font-weight: 800 !important;
}

/* Règles spécifiques pour s'assurer que les titres sont gras */
.mo-markdown h1,
.mo-markdown h2,
.mo-markdown h3,
.mo-markdown h4,
.mo-markdown h5,
.mo-markdown h6 {
  font-family: var(--marimo-heading-font) !important;
  font-weight: 800 !important;
  color: white !important;
}

/* Fond global */
body {
  background: radial-gradient(circle at top left, #0F1123, #090B17);
}

/* Optionnel : fond des cellules et bordures */
.mo-cell {
  background-color: rgba(255, 255, 255, 0.03);
  border: 1px solid rgba(255, 255, 255, 0.1);
  border-radius: 10px;
  padding: 1rem;
}

/* Watermark and protection styles */

/* Watermark overlay */
.watermark-overlay {
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    pointer-events: none;
    z-index: 9999;
    background-image: 
        repeating-linear-gradient(
            45deg,
            transparent,
            transparent 100px,
            rgba(0, 0, 0, 0.02) 100px,
            rgba(0, 0, 0, 0.02) 200px
        );
}

.watermark-overlay::before {
    content: '© 2025 Simulateur Freelance - Tous droits réservés';
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%) rotate(-45deg);
    font-size: 48px;
    color: rgba(0, 0, 0, 0.03);
    font-weight: bold;
    white-space: nowrap;
    pointer-events: none;
    user-select: none;
    -webkit-user-select: none;
    -moz-user-select: none;
    -ms-user-select: none;
}

/* Disable text selection */
body {
    -webkit-user-select: none;
    -moz-user-select: none;
    -ms-user-select: none;
    user-select: none;
    -webkit-touch-callout: none;
    -webkit-tap-highlight-color: transparent;
}

/* Allow selection only for input elements */
input, textarea, select {
    -webkit-user-select: text;
    -moz-user-select: text;
    -ms-user-select: text;
    user-select: text;
}

/* Disable highlighting */
::selection {
    background: transparent;
}

::-moz-selection {
    background: transparent;
}

/* Disable drag and drop */
* {
    -webkit-user-drag: none;
    -khtml-user-drag: none;
    -moz-user-drag: none;
    -o-user-drag: none;
    user-drag: none;
}

/* Disable image context menu */
img {
    -webkit-user-select: none;
    -moz-user-select: none;
    -ms-user-select: none;
    user-select: none;
    pointer-events: none;
    -webkit-touch-callout: none;
}

/* Hide print styles */
@media print {
    * {
        display: none !important;
    }
    
    body::before {
        content: 'Impression non autorisée - © 2025 Simulateur Freelance';
        display: block !important;
        position: fixed;
        top: 50%;
        left: 50%;
        transform: translate(-50%, -50%);
        font-size: 24px;
        color: red;
        font-weight: bold;
    }
}

/* Protection notice */
.protection-notice {
    position: fixed;
    bottom: 10px;
    right: 10px;
    background: rgba(0, 0, 0, 0.8);
    color: white;
    padding: 5px 10px;
    border-radius: 5px;
    font-size: 12px;
    z-index: 10000;
    pointer-events: none;
    user-select: none;
}

/* Blur sensitive content when DevTools detected */
.devtools-detected {
    filter: blur(10px);
    pointer-events: none;
}

/* Anti-screenshot protection */
.anti-screenshot {
    position: relative;
    overflow: hidden;
}

.anti-screenshot::after {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background: 
        repeating-linear-gradient(
            0deg,
            transparent,
            transparent 2px,
            rgba(255, 255, 255, 0.01) 2px,
            rgba(255, 255, 255, 0.01) 4px
        ),
        repeating-linear-gradient(
            90deg,
            transparent,
            transparent 2px,
            rgba(255, 255, 255, 0.01) 2px,
            rgba(255, 255, 255, 0.01) 4px
        );
    pointer-events: none;
    z-index: 1;
}

/* Disable outline on focus for security */
* {
    outline: none !important;
}

/* Hide scrollbars to prevent easy navigation */
::-webkit-scrollbar {
    width: 0px;
    background: transparent;
}

/* Disable text cursor in non-input elements */
body, div, span, p, h1, h2, h3, h4, h5, h6 {
    cursor: default !important;
}

            e.preventDefault();
            return false;
        }
        
        // Ctrl+S (Save)
        if (e.ctrlKey && e.key === 's') {
            e.preventDefault();
            return false;
        }
        
        // Ctrl+A (Select All)
        if (e.ctrlKey && e.key === 'a') {
            e.preventDefault();
            return false;
        }
        
        // Ctrl+P (Print)
        if (e.ctrlKey && e.key === 'p') {
            e.preventDefault();
            return false;
        }
    });
    
    // Disable text selection
    document.addEventListener('selectstart', function(e) {
        e.preventDefault();
        return false;
    });
    
    // Disable drag and drop
    document.addEventListener('dragstart', function(e) {

            if (!devtools) {

                console.clear();
                console.log('%c⚠️ Outils de développement détectés', 'color: red; font-size: 16px; font-weight: bold;');
                console.log('%cL\'accès au code source est interdit.', 'color: red; font-size: 14px;');
            }
        }
    }, 500);
    
    // Disable image saving
    document.addEventListener('DOMContentLoaded', function() {
        const images = document.querySelectorAll('img');
        images.forEach(img => {
            img.addEventListener('contextmenu', function(e) {
                e.preventDefault();
                return false;
            });
            img.draggable = false;
        });
    });
    
    // Protection against iframe embedding
    if (window.top !== window.self) {
        window.top.location = window.self.location;
    }
    
    // Clear console periodically
    setInterval(function() {
        console.clear();
        console.log('%c⚠️ Console effacée automatiquement', 'color: orange; font-size: 12px;');
    }, 30000);
    
})();
</script>
